/* RTL direction for the whole form */
.form-all {
    direction : rtl !important;
    padding : 20px;
    box-sizing : border-box;
}

/* Fix label alignment and spacing */
.form-label {
    float : none !important;
    text-align : right !important;
    display : block !important;
    margin-bottom : 6px;
    font-weight : bold;
}

/* Full-width inputs */
.form-textbox,
.form-textarea,
.form-dropdown,
.form-input,
.form-input-wide {
    box-sizing : border-box;
}

/* Responsive layout for checkboxes */
.form-checkbox-item,
.form-single-column {
    display : flex !important;
    align-items : center;
    flex-direction : row-reverse;
    text-align : right !important;
}


@media screen and (max-width: 480px){
    .form-checkbox-item, .form-single-column {
        gap : 20px;
    }

    label.form-label.form-label-auto, label.form-label:not(.form-label-top) {
